- input: "TEXT\x1CC00300376\x1C1\x1C\x1CF3XA\x1COn July 25, 2007 the 2007 mid-year
    FEC report was filed with an incorrect starting balance of (6,209.47).  On April
    28, 2010 DOCPAC filed an Amended 2007 mid-year FEC report with a correct starting
    balance of 19,213.83.  The difference between these two starting balances is 25,423.30
    and is explained below.  DOCPACs internal audit found that from the inception
    of the PAC until 2003 there were issues regarding the timing of reporting contributions.
    \ These contributions in this time period, totaling 16,967.76, are 67 percent
    of the 25,423.30 that DOCPAC was off at the beginning of 2007.  DOCPAC does not
    have records beyond this period sufficient to account for this error.  From 2004
    thru 2006 we noted a net difference of 8,455.54 (the other 33 percent of the 25,423.30)
    between our reported cash contributions and recorded cash contributions.  The
    following is a break down of the differences by year.  You will note that the
    differences for 2004 and 2005 were about 1,000 each with a slight increase in
    2006:  2004 - 939.96 (40,368.93 recorded vs. 39,428.97 reported) 2005 - 1,011.53
    (72,511 recorded vs. 71,499.47 reported) 2006 - 6,504.05 (106,123.14 recorded
    vs. 99,633.09 reported)  These errors occurred because contributions were not
    always reported for the period in which they were received.  In some cases contributions
    were reported in a subsequent period.  In other cases contributions were never
    reported.  As a result of our recent audit, we have modified our internal business
    process to remedy the issue above.\n"
